    gauss1       = @(p,x) 1./(sqrt(2*pi)*p) * exp(-x.^2./(2*p.^2));%@(p,x) 1./(2*pi*p.^2) * exp(-x.^2./(2*p.^2));   
    gauss2       = @(w, p1, p2, x) ((1-w) * gauss1(p1,x) + w * gauss1(p2,x));
    objFunc2     = fittype(gauss2);

    sigma0 = interp1(machine.data(70).initFocus.dist, machine.data(70).initFocus.sigma, 1878.5);
    start2 = [0.1, sigma0, sigma0+10];
    lb2 = [0.0001, 0,0];
    ub2 = [1, sigma0+500, sigma0+500];
    
     weightFit2 = zeros(size(profileFit1'));
     weightFit2(profileFit1>0) = 1./profileFit1(profileFit1>0);

     [fitObject2,gof2,output2] = fit(rdepthFit1', profileFit1, objFunc2, ...
         'Start', start2, 'Lower', lb2, 'Upper', ub2,  'Weight',weightFit2);
    
    doubleSigma_MC(depth_idx,:) = [fitObject2.w, fitObject2.p1, fitObject2.p2];
    
    if visBool
        figure;
        subplot(1,2,1);
        plot(x, profile_MC, '.-');
        hold on;
        plot(x, gauss2(doubleSigma_MC(depth_idx,1),doubleSigma_MC(depth_idx,2),doubleSigma_MC(depth_idx,3), x), '.-');
        xline(x(iFit1));
        xline(x(iFit2));
    
        xlim([-50,50]);
        legend('MC', 'fit');
    end
    %%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
    %[~, iFit1] = min(abs(profile_matRad - 0.0001* profile_matRad));
    iFit1 = 1;%find(profile_matRad > 0.00000*max(profile_matRad), 1,'first');
    iFit2 = 160;%find(profile_matRad > 0.00000*max(profile_matRad), 1,'last');
    if iFit1 > 1 && iFit2 <160
        profileFit1 = profile_matRad(1:iFit1);
        rdepthFit1 = x(1:iFit1);
        radialFitMax1 = rdepthFit1(end);
    else
        profileFit1 = profile_matRad;
        rdepthFit1 = x;
        radialFitMax1 = rdepthFit1(end);
    end
  
    gauss2       = @(w, p1, p2, x) ((1-w) * gauss1(p1,x) + w * gauss1(p2,x));
    objFunc2     = fittype(gauss2);

    sigma0 =  interp1(machine.data(70).initFocus.dist, machine.data(70).initFocus.sigma, 1760);
    start2 = [0.1, sigma0, sigma0+10];
    lb2 = [0.0001, 0, 0];
    ub2 = [1, sigma0+500, sigma0+500];
    
     weightFit2 = zeros(size(profileFit1'));
     weightFit2(profileFit1>0) = 1./profileFit1(profileFit1>0);

     [fitObject2,gof2,output2] = fit(rdepthFit1', profileFit1, objFunc2, ...
         'Start', start2, 'Lower', lb2, 'Upper', ub2,  'Weight',weightFit2);

    doubleSigma_matRad(depth_idx,:) = [fitObject2.w, fitObject2.p1, fitObject2.p2];
    sigmaIni_sq = sigma0^2;

    eqDepth = (depth_idx-39)*3 +1.5;
    %machineIdx = interp1(machine.data(70).depths, [1:size(machine.data(70).depths,1)]', eqDepth, 'nearest');
    doubleSigma_machine(depth_idx,:) = interp1(machine.data(70).depths, [machine.data(70).weight, machine.data(70).sigma1, machine.data(70).sigma2],eqDepth);%[machine.data(70).weight(machineIdx), sqrt(machine.data(70).sigma1(machineIdx)^2 + sigmaIni_sq), sqrt(machine.data(70).sigma2(machineIdx)^2 + sigmaIni_sq)];
    doubleSigma_machine(depth_idx, 2) = sqrt(doubleSigma_machine(depth_idx, 2).^2 + sigmaIni_sq);
    doubleSigma_machine(depth_idx, 3) = sqrt(doubleSigma_machine(depth_idx, 3).^2 + sigmaIni_sq);

    if visBool
        subplot(1,2,2);
        plot(x, profile_matRad, '.-');
        hold on;
        plot(x, gauss2(doubleSigma_matRad(depth_idx,1),doubleSigma_matRad(depth_idx,2),doubleSigma_matRad(depth_idx,3),x), '.-');
        plot(x, profile_MC,'.-');%(doubleSigma_MC(depth_idx,1),doubleSigma_MC(depth_idx,2),doubleSigma_MC(depth_idx,3),x), '.-');
        %plot(x, gauss2(doubleSigma_machine(depth_idx,1),doubleSigma_machine(depth_idx,2),doubleSigma_machine(depth_idx,3),x), '.-')
        legend('matRad plan', 'fit', 'MC');
        xline(x(iFit1));
        xline(x(iFit2));
        xlim([-50,50]);
    end

end

